@SpitfireWings Raven scrunched up her nose, chuckling before listening once more to Ianto. 

‘—Who’s Evangeline?’ Immediately wondering if she’d pried too much into his personal life that wasn’t any of her business, blushing a deep shade of red before clearing her throat. 

The question —

Don’t want no other shade of blue but you, no other sadness in the world would do🍃💙

It’s festive season! Indian is the style!
